import React from "react";

const Booklist = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        marginTop: "50px",
        padding: "1.5% 10% 1.5% 10%",
        backgroundColor: "teal",
        fontSize: "20px"
      }}
    >
      <p>Title</p>
      <p>Author</p>
      <p>ISBN</p>
      <input type="checkbox"></input>
    </div>
  );
};

export default Booklist;
